import styles from './Table.module.scss'
import clsx from 'clsx';

const Table = (props) => {

  return (
    <div>
      <li className={clsx("d-flex justify-space-between p-3", styles.table)}>
        <h2 className="col-6">Table {props.id} </h2>
        <p className="col-6"><span className={styles.status}>Status:</span> {props.status} </p>
      </li>
      <div className="text-center"><button className="btn-default p-3 m-3">Show more</button></div>
    </div>
  )
}

export default Table;
